import React from 'react';
import classes from './Main.module.css';

const main = (props) => {
    return (
        <div className={classes.Main} >
            <div className={classes.img-1}>
            </div>
            <div className={classes.img-2}>
            </div>
            <div className={classes.img-3}>
            </div>
            <div className={classes.img-4}>
            </div>
        </div>
    );
}

export default main;
